import './AboutMe.css';
import photo from "../../../assets/photo.jpg";

export default function AboutMe() {
    return (
        <div className="scrollable-wrapper upper-gradient">
            <div className="half_screen">
                <div className="centered-text">
                    <p>Hello!</p>
                    <h1 id="slider" className="slide-in">My name is <mark>Davide</mark></h1>
                    <h2>I'm a <mark>full-stack developer</mark> and <mark>computer vision specialist</mark></h2> 
                </div>
            </div>
            <div className="half_screen">
                <img src={photo}></img>
            </div>
        </div>
    );
}
